insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077002, 53, 190802, 1, '花凜', '將任務完成，\\n並獲得獎勵吧！', 2, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -416.5, 0.0, 3.099, 2, 10077);
insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077003, 54, 190802, 1, '花凜', '似乎有能夠\\n領取的獎勵了，\\n請確認看看。', 3, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -416.5, 0.0, 2.801, 2, 10077);
insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077004, 54, 190802, 2, '花凜', '能夠領取獎勵了！\\n請檢查看看', 4, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -416.5, 0.0, 0.0, 2, 10077);
insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077005, 57, 190802, 1, '花凜', '參加活動辛苦了！\\n各位活躍的樣子\\n我們始終非常感謝', 5, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -416.5, 0.0, 0.0, 1, 10077);
insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077006, 55, 190802, 1, '花凜', '這裡是公會管理協會！\\n如果您持有的討伐證，\\n就能夠交換獎勵哦。', 1, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -363.0, 0.0, 5.506, 2, 10077);
