insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10077008, 56, 190802, 2, '花凜', '辛苦了\\n別忘記使用討伐證\\n來進行交換哦！', 3, '2022/02/14 16:00:00', '2022/02/25 15:59:59', -363.0, 0.0, 1.539, 1, 10077);
