insert into v1_bd96a68289fd8695c5476a1df692acad5dd65cfcb9bfdd8da4a379de6f88bf0c values (10112005, 57, 190801, 1, '花凜', '參加活動辛苦了！\\n各位活躍的樣子\\n我們始終非常感謝', 5, '2023/06/16 16:00:00', '2023/06/30 15:59:59', -416.5, 0.0, 0.0, 1, 10112);
